Here are the steps I took to help reproduce the issue

1. Trained a model following the steps in the tutorial. The data and output model are attached below
Data (Only a subset of 12 columns were used): [TrainingData.zip](https://github.com/apple/turicreate/files/4721317/TrainingData.zip)
Model (window size of 75): [ShoulderAbductionClassifier.mlmodel.zip](https://github.com/apple/turicreate/files/4721321/ShoulderAbductionClassifier.mlmodel.zip)

2. Imported the model into Xcode and ran a prediction on an iPad mini 5 using the same training data stored as csv:

```swift
let filePath = Bundle.main.path(forResource: "shoulder_1_1", ofType: "csv");
let fileUrl = NSURL.fileURL(withPath: filePath!)

do {
    let file = try String(contentsOf: fileUrl)
    let rows = file.components(separatedBy: .newlines)
    for row in rows {
        let fields = row.replacingOccurrences(of: "\"", with: "").components(separatedBy: ", ")

        var dataSample: [Float] = Array(repeating: 0.0, count: numRecordedJoints*6)
        if(fields.count>dataSample.count){
            for index in 0...dataSample.count-1 {
                dataSample[index] = Float(fields[index]) ?? 0.0
            }
        }
        addAccelSampleToDataArray(posSample: dataSample)
    }
} catch {
    print(error)
