@christinalau thanks for providing that. I spent quite some time today trying to make sense of this. Here's what I think is going on:

The last inner product layer in your model has a small number of parameters. When we increase the learning rate, the network is forgetting some things it previously learnt. It is called "Catastrophic Forgetting in Neural Networks" https://arxiv.org/abs/1708.02072

It is unfortunate that marking inner product layer before batchnorm as updatable fails to compile. I am trying out a few things to see if that helps your use case.

