You tried a really good experiment. Clearly, loss is going down but, not as fast as you'd want to make a difference in accuracy.

This means we need to tune the hyper-parameter for this model. Could you try increasing learning rate? You could try different values - like 0.02, 0.03, 0.05, 0.1, 0.15, etc. Here's how you'd do that:

```
let configuration = MLModelConfiguration()

// requests training loop run for 10 iterations and use 0.02 learning rate
configuration.parameters = [MLParameterKey.epochs : 10, MLParameterKey.learningRate : 0.02]

let progressHandlers = MLUpdateProgressHandlers(forEvents: .epochEnd,
                                                progressHandler: progressHandler,
                                                completionHandler: completionHandler)

let updateTask = try MLUpdateTask(forModelAt: updatableModelURL,
                                  trainingData: trainingData,
                                  configuration: configuration,
                                  progressHandlers: progressHandlers)

// start the update process
updateTask.resume()
```

`progressHandler` would look something like:

```
func progressHandler(_ context: MLUpdateContext) {
    // print context.metrics[MLMetricKey.loss]
}
```

See if loss goes down for each epoch.

Here's more details on the API usage: https://github.com/apple/coremltools/blob/master/examples/updatable_models/OnDeviceTraining_API_Usage.md

