@dogahe The privacy concern is mostly around the app data containing the information for other users than the current user. While it's not straightforward for a typical user to do, a malicious actor could in theory extract information from the app once it's downloaded from the App Store, and if that includes a model that includes user data, they could get access to that user data. (Whereas while you are developing your model, it stays on your machine(s) and isn't downloaded to anyone else.) When a model is queryable by user ID, it necessarily contains the interaction data for the users whose IDs it can be queried for, and we don't expect most app developers would be comfortable shipping that data anywhere.

Another reason we don't include all the user ID mappings in the model is that it greatly inflates the model size; over 50% of the size of a typical Turi Create recommender model is that user data, so by removing the ability to query by user ID, we also produce a much smaller model for use with Core ML.

