@cianiandreadev has a great point, so let me re-iterate the different scenarios and the expected behavior (which I have experimentally verified at least on my setup):

1. You have a model with NMS (type: Pipeline) and targeting iOS 12 that has been sufficiently trained and pointing at an object of interest: You should get an `VNRecognizedObjectObservation` object. If not, it could simply be a false negative (failure of the algorithm to detect the object), so try multiple objects (if you point it at a training sample, it should definitely fire).

2.  You have a model with NMS (type: Pipeline) and targeting iOS 12, but you did not sufficiently train the model. In this case, your result array will simply be empty. For instance, a model after only 10 iterations will always give no predictions whatsoever, since it hasn't gained enough confidence to do anything else. If you still want to do this for quick testing, make sure to set confidence threshold to 0, so that no predictions are eliminated due to low confidence. You should start seeing some `VNRecognizedObjectObservation`, but they will not be good predictions.

3. You have a model without NMS (type: Neural Network). Vision will return a `VNCoreMLFeatureValueObservation` object each iteration. This information need to be processed further to be interpreted as predictions. The BreakfastFinder app will unfortunately not give any indication that this is happening, but you can add something like this inside `drawVisionRequestResults` to check what is being returned:
    ```swift
            for observation in results {
                print("observation %s", observation)
            }
    ```

4. You do not have iOS 12 (which is the only case I haven't experimentally verified yet), in which case I believe the results will be the same as point 3, regardless of the Core ML model.

Looking through a lot of the earlier comments in this issue, I think many of you have were hitting one of these expected behaviors. The problem is that between TurI Create and the BreakfastFinder app, we have done a really poor job communicating these subtle differences and what the expected outcome should be. That is something that we need to address through better  documentation or changing the example code.

However, if there is someone that does not fall into these four cases, then that is definitely a bug and a separate issue. It sounds like this is what might be happening for @nthState and @amiraeitan, so let's dig further. 

