@vpndemand - there is currently no way to get images from the Core ML model. You will need to store the images used to create the model in your app. The Core ML model just returns the distances from your input image to all of the images used to create the model. The n-th index in the array returned by the Core ML Model corresponds to the distance from your input image to the n-th image passed to `tc.image_similarity.create(...)`. 

